import Link from "next/link";
import Header from "../components/header";

const Home = () => {
  return (
    <div>
      <Header />
      <h1>Welcome to SW4T</h1>
      <Link href="/about">Learn more about SW4T</Link>
    </div>
  );
};

export default Home;
